import React from "react";
import { Link } from "react-router-dom";

export default function Guitars() {
  return (
    <div className="p-6 max-w-3xl mx-auto">
      <h2 className="text-3xl font-bold mb-6">Handcrafted Guitars</h2>
      <p className="text-lg text-gray-700 mb-4">Each guitar I build has its own story, tone, and character. From swamp ash Telecasters to experimental full-hollow builds.</p>
      <ul className="list-disc pl-6 text-gray-700 mb-6">
        <li>“더프” – a swamp ash tele with vintage P90s</li>
        <li>“쿠텔” – a full hollow tele-style with condenser mic pickup</li>
        <li>“험텔” – humbucker-equipped walnut telecaster</li>
      </ul>
      <Link to="/" className="text-blue-500 hover:underline">← Back to Home</Link>
    </div>
  );
}
